import logo from "./logo.svg";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  BrowserRouter,
} from "react-router-dom";
import Wishlist from "./components/WishlistList/WishlistList";
import ItemList from "./components/WishlistList/ItemList";

import { Outlet, Link } from "react-router-dom";

const Layout = () => {
  return (
    <Router>
      <>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/blogs">Blogs</Link>
            </li>
            <li>
              <Link to="/contact">Contact</Link>
            </li>
          </ul>
        </nav>

        <Outlet />
      </>
    </Router>
  );
};

const NoPage = () => {
  return <h1>404</h1>;
};

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route index element={<Wishlist />} />
        <Route path="wishlist/:id" element={<ItemList />} />
        <Route path="*" element={<NoPage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
